  const addQuery = (searchQuery) => {
    setQueries((searchQueries) => [query, ...queries])
    };
  return (
    <div>
      <Header/>
      <Searchbar addQuery={addQuery}/>
      <div className='wrapper'>
      <Searchresults />
      <Playlist />
      </div>
    </div>
  );
}

export default App;
